function CardDest(props) {
    return (
        <div class="col-sm-6 col-md-6 col-lg-3 ">
            <Link to="/acceuil" className="mx-4 link"></Link>
                <div class="card card1" style={{borderRadius: "15px"}}>
                    <h5>{props.title}</h5>
                    <p>{props.subtitle}</p>
                </div>
                
        </div>
    );
}

export default CardDest;
